(1, 'How To Buy', 2, 'how-to-buy', '<h2>Cara berbelanja&nbsp;</h2><h3>A. Berbelanja dengan registrasi&nbsp;</h3><ol><li>Pilih produk / barang yang ingin anda beli. Anda dapat menelusuri melalui kategori produk yang tersedia atau langsung memasukkan kata kunci terkait pada kotak pencarian (Search box).</li><li>kunjungi halaman detail produk yang ingin anda beli.</li><li>Masukkan jumlah barang dan&nbsp;klik tombol "Add to cart" yang tersedia pada halaman produk.</li><li>Klik link "Go to checkout" jika anda untuk menyelesaikan pesanan anda atau klik "Continue Shopping" untuk lanjut berbelanja <img alt="" src="http://indocasio.co.id/uploads/page/content/article_content_1435001854.png">.</li><li>Jika anda sebelumnya telah terdaftar lakukan login pada form login yang tersedia. or&nbsp;Atau klik link "Register" untuk mendaftarkan akun baru.&nbsp;</li><li>Lengkapi form register dengan data diri anda seperti nama lengkap, alamat email, no telp dan password, lalu klik register.&nbsp;</li><li>Masukkan alamat anda pada form yang tersedia untuk tujuan pengiriman pesanan.&nbsp;dan klik tombol "order confirmation" untuk konfirmasi order.<img alt="" src="http://indocasio.co.id/uploads/page/content/article_content_1435002560.png">&nbsp;</li><li>Pada halaman konfirmasi, pilih paket pengiriman yang anda kehendaki, dan centang "Delivery Assurance" bila anda ingin menggunakan asuransi pengiriman. Pilih metode pembayaran yang ingin anda gunakan, tersedia 2 metode pembayaran Transfer ATM &amp; Credit Card. Lalu klik "Place order".&nbsp;<img alt="" src="http://indocasio.co.id/uploads/page/content/article_content_1435003867.png"></li><li>Proses checkout selesai, kami akan mengirimkan informasi detail dan no.rekening untuk pembayaran&nbsp;pada email anda dan menginformasikan setiap pembaruan terkait status pesanan anda via email.&nbsp;</li><li>Transfer ke no. rekening yang telah kami informasikan pada email anda. kemudian lakukan konfirmasi pembayaran untuk menginformasikan pembayaran anda kepada kami.&nbsp;&nbsp;</li></ol><br><h3>B. Berbelanja tanpa registrasi (Quick Checkout)</h3><ol><li>Pilih produk / barang yang ingin anda beli. Anda dapat menelusuri melalui kategori produk yang tersedia atau langsung memasukkan kata kunci terkait pada kotak pencarian (Search box).</li><li>kunjungi halaman detail produk yang ingin anda beli.</li><li>Masukkan jumlah barang dan&nbsp;<br>klik tombol "Add to cart" yang tersedia pada halaman produk.</li><li>Klik link "Go to checkout" jika anda untuk menyelesaikan pesanan anda atau klik "Continue Shopping" untuk lanjut berbelanja&nbsp;</li><li>Masukkan data anda pada form quick checkout yang ada di seblah kanan, lalu klik "next step"&nbsp;<img alt="" src="http://indocasio.co.id/uploads/page/content/article_content_1435004878.png"></li><li>Masukkan alamat anda pada form yang tersedia untuk tujuan pengiriman pesanan.&nbsp;</li><li>Pada halaman konfirmasi, pilih paket pengiriman yang anda kehendaki, dan centang "Delivery Assurance" bila anda ingin menggunakan asuransi pengiriman. Pilih metode pembayaran yang ingin anda gunakan, tersedia 2 metode pembayaran Transfer ATM &amp; Credit Card. Lalu klik "Place order".&nbsp;<br></li><li>Proses checkout selesai, kami akan mengirimkan informasi detail dan no.rekening untuk pembayaran&nbsp;pada email anda dan menginformasikan setiap pembaruan terkait status pesanan anda via email.&nbsp;</li><li>Transfer ke no. rekening yang telah kami informasikan pada email anda. kemudian lakukan konfirmasi pembayaran untuk menginformasikan pembayaran anda kepada kami. &nbsp;</li></ol><br><br>', 1, 1, 1434267939, 1477207747),
(3, 'Terms & Condition', 1, 'terms-condition', '<b>KETENTUAN GARANSI PRODUK JAM TANGAN&nbsp;CASIO ORIGINAL</b><br><b><br></b>* Garansi berlaku selama 1 Tahun, terhitung sejak tanggal pembelian<br>* Masa berlaku, detail dan ketentuan garansi barang adalah mengikuti ketentuan Casio Indonesia<br>* Produk CASIO anda dijamin dari kerusakan-kerusakan yang <b>DISEBABKAN OLEH KESALAHAN PABRIK</b> selama satu tahun, terhitung sejak tanggal pembelian.<br>* Garansi produk CASIO tidak berlaku untuk bagian yang habis pakai atau dengan resistensi terbatas ( rantai, baterai, bak arjoli, plat, puteran, tombol, kaca, ataupun juga bila berembun maupun mesin yang berkarat karena kemasukan air )<br>* Klaim garansi harus disertai Kartu Garansi yang diisi lengkap serta cap / stempel toko<br><br><br><b>GARANSI TIDAK BERLAKU / BATAL BILA:</b><br><b><br></b>- Kartu garansi hilang, rusak atau tidak dapat diperlihatkan<br>- Kerusakan yang diakibatkan oleh pengoperasian diluar spesifikasi produk, kesalahan pemakai, transportasi, bencana alam, kecelakaan, kebakaran, perubahan tegangan listrik karena petir atau air, hewan, virus dan jamur<br>- Kerusakan karena pemakaian / perawatan yang tidak tepat, kasar atau ceroboh<br>- Kerusakan disebabkan karena <b>PERLAKUAN MERUSAK / SENGAJA DIRUSAK / TOUGH TEST</b>… dsb.. ( misal: pecah, retak, somplak, terbakar, terendam air, dirusak, dibanting, dibakar, dihantam, dilindas, digilas, dlsb ) dan segala kerusakan yang diakibatkan oleh pemakaian ( bukan bawaan dari pabrik )<br>- Kerusakan disebabkan perbaikan yang tidak tepat atau dikerjakan oleh selain service resmi CASIO<br>- Produk telah direparasi / dirubah atas permintaan sendiri atau pihak lain, sehingga keadaannya berubah dari aslinya atau menjadi rusak / cacat<br>- Pembelian yang dilakukan diluar wilayah Indonesia<br>- Nomor seri dihapus / dirubah<br>- Masa garansi telah kadaluarsa / lewat masa garansi<br><br><br><b>GARANSI TIDAK TERMASUK :</b><br><b><br></b>- Accesories seperti : Kabel data, tinta, baterai, adaptor, pita ( Label ) dan bagian dari mesin termasuk Carrying case<br>- Rantai arloji, kaca arloji, baterai yang rusak atau usang<br>- Bagian yang habis pakai atau dengan resistensi terbatas ( rantai, baterai, bak arloji, plat, puteran, tombol, kaca, ataupun juga bila berembun maupun mesin yang berkarat karena kemasukan air )<br><br><br>- Semua biaya yang dikeluarkan untuk Klaim garansi ditanggung oleh pembeli.<br>- Barang yang sudah dibeli tidak dapat dikembalikan &amp; ditukar<br>- Selama dalam masa garansi, Klaim garansi, Perbaikan dapat diajukan kepada Casio Indonesia<br><br><b>CASIO SERVICE CENTER</b><br><b>JAKARTA - JUANDA</b><br>JL. IR. H. JUANDA NO 11B<br>TELP : 3858318<br>Fax : 3811850<br><br><b>SURABAYA - MANYAR</b><br>JL. RAYA MANYAR NO 41B&nbsp;<br>SURABAYA 60118<br>TELP : 031-5965851<br>FAX : 031-5965852', 1, 1, 1434271215, 1477207714),
