(1038, 'PRG-280D-7', 'PRG-280D-7', 'PRG-280D-7', 'PRG280D7', 18, '1448630556.png', 1, '', 56.6, 53.7, 15.6, '<strong>TWIN SENSOR<br></strong>Introducing the Twin Sensor (direction, temperature) additions to the PRO TREK lineup.<br>Super Illuminator keeps information readable even in the dark, while onepush button operation for sensor functions and display illumination enable easy operation. Other features include 200-meter water resistance and low-temperature (–10ºC/14ºF) resistance for plenty of toughness for the outdoor adventurer.<br><ul><li><b>Direction Bezel</b></li><li><b>Mineral Glass</b></li><li><b>Neobrite</b></li><li><b>200-meter water resistance</b></li><li><b>Case / bezel material: Resin / Stainless steel</b></li><li><b>Double-lock, 3-fold Clasp</b></li><li><b>Stainless Steel Band</b></li><li><b>Solid Band</b></li></ul><ul><li>LED light (Super Illuminator)<br>Auto light switch, selectable illumination duration (1.5 seconds or 3 seconds), afterglow</li><li>Low-temperature resistant (–10°C/14°F)</li><li>Digital compass (NORTH)<br>Hand indication of north (20 seconds continuousmeasurement)<br>Measures and displays direction as one of 16 points<br>Measuring range: 0 to 359°<br>Measuring unit: 1°<br>Bidirectional calibration<br>Magnetic declination correction<br>Bearing memory</li><li>Thermometer<br>Display range: –10 to 60°C (14 to 140°F)<br>Display unit: 0.1°C (0.2°F)<br>*Changeover between Celsius (°C) and Fahrenheit (°F)</li><li>World time<br>31 time zones (48 cities + coordinated universal time), city code display, daylight saving on/off</li><li>1/100-second stopwatch<br>Measuring capacity: 23:59''59.99''''<br>Measuring modes: Elapsed time, split time, 1st-2nd place times</li><li>Countdown timer<br>Measuring unit: 1 second<br>Countdown range: 60 minutes<br>Countdown start time setting range: 1 minute to 60 minutes (1-minute increments)</li><li>5 daily alarms (with 1 snooze alarm)</li><li>Hourly time signal</li><li>Full auto-calendar (to year 2099)</li><l