(1040, 'PRG-240T-7', 'PRG-240T-7', 'PRG-240T-7', 'PRG240T7', 18, '1448631302.jpg', 1, '', 57.3, 50.9, 15.3, 'The evolution of PROTREK never stops. These new models embody some of the very best in functional beauty and ease of operation that modern technology has to offer.&nbsp;<br><br>• The rotary bezel is specially shaped for easy operation, even while wearing gloves. Large letters indicating north, south, east, and west are colored for easy reading.&nbsp;<br>• Dedicated direction, barometer, and altitude buttons provide one-touch access to measurements. Buttons are large with slanted diamond patterns for plenty of slip resistance during operation.<br>• Since "easy to press" often also means "more operation error", the back cover is designed to make it the same height of the button surfaces, which greatly reduces the chance of operation error. The result is easy button operation, but only when you need it to be.<br><br>The number of pointer lines has been increased from 60 to 72 for easier to read World Time and sunrise times. TOUGH SOLAR ensures stable operation even when using power-hungry functions.<br><ul><li><b>Direction Bezel</b></li><li><b>Mineral Glass</b></li><li><b>100-meter water resistance</b></li><li><b>Case / bezel material: Resin</b></li><li><b>Double-lock, 3-fold Clasp</b></li><li><b>Titanium Band</b></li></ul><ul><li>Electro-luminescent backlight<br>Full auto EL light, selectable illumination duration, afterglow</li><li>Solar powered</li><li>Low-temperature resistant (-10 °C/14 °F)</li><li>Digital compass<br>Measures and displays direction as one of 16 points<br>Measuring range: 0° to 359°<br>Measuring unit: 1°<br>20 seconds continuous measurement<br>Graphic direction pointer<br>Bidirectional calibration and northerly calibration function<br>Magnetic declination correction<br>Bearing memory</li><li>Altimeter<br>Measuring range: -700 to 10,000 m (-2,300 to 32,800 ft.)<br>Measuring unit: 5 m (20 ft.)<br>Manual memory measurements<br>(up to 25 records, each including altitude, date, time)<br>High Altitude / Low Altitude memory<br>Total Ascent / Descent memory<br>Others: Reference altitude setting, Altitude tendency graph, Altitude differential<br>*Changeover between meters (m) and feet (ft)</li><li>Barometer<br>Display range: 260 to 1,100 hPa (7.65 to 32.45 inHg)<br>Display unit: 1 hPa (0.05 inHg)<br>Atmospheric pressure tendency graph<br>Atmospheric pressure differential graphic<br>*Changeover between hPa and inHg</li><li>Thermometer<br>Display range: -10 to 60 °C (14 to 140 °F)<br>Display unit: 0.1 °C (0.2 °F)<br>*Changeover between Celsius (°C) and Fahrenheit (°F)</li><li>Duplex LC display</li><li>World time<br>31 time zones (48 cities), city code display, daylight saving on/off</li><li>Sunrise, sunset time display<br>Sunrise time and sunset time for specific date, Daylight pointers</li><li>1/100-second stopwatch<br>Measuring capacity: 23:59''59.99''''<br>Measuring modes: Elapsed time, split time, 1st-2nd place times</li><li>Countdown timer<br>Measuring unit: 1 second<br>Countdown start time setting range: 24 hours<br>Countdown start time setting range: 1 minute to 24 hours (1- minute increments and 1-hour increments)</li><li>Daily alarms<br>5 independent daily alarms</li><li>Hourly time signal</li><li>Battery level indicator</li><li>Power Saving (Display goes blank to save power when the watch is left in the dark.)</li><li>Full auto-calendar (to year 2099)</li><li>12/24-hour format</li><li>Button operation tone on/off</li><li>Regular timekeeping:<br>Hour, minute, second, pm, year, month, date, day</li><li>Accuracy: ±15 seconds per month</li><li>Approx. battery operating time:<br>6 months on rechargeable battery (operation period with normal use without exposure to light after charge)<br>23 months on rechargeable battery (operation period when stored in total darkness with the power save function on after full charge)</li><li>Size of case:?57.3?×?50.9?×?15.3?mm</li><li>Total weight: 111.4 g</li><li>EL:Blue Green</li></ul>', 2, 0, 0, 111.4, 5455000, 0, 2, 2132000, 1, 1448631302, 1478243515),
(1041, 'PRG-250-1', 'PRG-250-1', 'PRG-250-1', 'PRG2501', 18, '1448632345.jpg', 1, '', 56.3, 50.6, 50.6, '200-meter water resistance for an expanded sphere of activity<br>Introducing new PRO TREK high-performance outdoor watch for various environments including mountain and ocean. This watch not only offers the compass bearing and altitude features necessary for mountain climbing, but also strong water-resistance for river climbing and river rafting where the user may encounter strong water pressure, as well as convenient tide information for sea kayaking and fishing.<br>With a large display delivering outstanding readability, the PRG-250 has a dual-layer LCD construction. The sensor and other data are shown on the upper and lower LCDs, allowing the user to easily see the desired information.<br>In addition to being displayed numerically and in a trend graph, atmospheric pressure is shown using simply designed arrow icons which depict characteristic barometric pressure patterns. This function was developed under the supervision of a meteorologist. Consequently, an upward arrow is displayed when the atmospheric pressure suddenly rises, forecasting better weather ahead.<br>A downward arrow appears when the pressure suddenly falls, indicating weather deterioration.<br>There are also arrow icons to show when rising pressure changes to falling pressure, or vice versa, making it easy to ascertain weather changes.<br>• Tough Solar<br>• Triple Sensor: Compass, Barometer/Thermometer, Altimeter<br><span>• Low temperature resistant (-10ºC/14°F)<br></span><ul><li><b>Direction Bezel</b></li><li><b>Mineral Glass</b></li><li><b>200-meter water resistance</b></li><li><b>Case / bezel material: Resin / Aluminum</b></li><li><b>Resin Band</b></li></ul><ul><li>Electro-luminescent backlight<br>Full auto EL light, selectable illumination duration, afterglow</li><li>Solar powered</li><li>Low-temperature resistant (-10°C/14°F)</li><li>Digital compass<br>Measures and displays direction as one of 16 points<br>Measuring range: 0° to 359°<br>Measuring unit: 1°<br>20 seconds continuous measurement<br>Graphic direction pointer<br>Bidirectional calibration and northerly calibration function<br>Magnetic declination correction<br>Bearing memory</li><li>Altimeter<br>Measuring range: -700 to 10,000 m (-2,300 to 32,800 ft.)<br>Measuring unit: 5 m (20 ft.)<br>Manual memory measurements<br>(up to 14 records, each including altitude, date, time)<br>High Altitude / Low Altitude memory<br>Total Ascent / Descent memory<br>Others: Reference altitude setting, altitude differential<br>*Changeover between meters (m) and feet (ft)</li><li>Barometer<br>Display range: 260 to 1,100 hPa (7.65 to 32.45 inHg)<br>Display unit: 1 hPa (0.05 inHg)<br>Atmospheric pressure tendency graph<br>Atmospheric pressure differential graphic<br>*Changeover between hPa and inHg</li><li>Barometric pressure change indicator</li><li>Thermometer<br>Display range: -10 to 60°C (14 to 140°F)<br>Display unit: 0.1°C (0.2°F)<br>*Changeover between Celsius (°C) and Fahrenheit (°F)</li><li>Moon data (moon age of the specific date, moon phase graph)</li><li>Tide graph (tide level for specific date and time)</li><li>Duplex LC display</li><li>World time<br>31 time zones (48 cities + coordinated universal time), city code display, daylight saving on/off</li><li>1/100-second stopwatch<br>Measuring capacity: 23:59''59.99''''<br>Measuring modes: Elapsed time, split time, 1st-2nd place times</li><li>Countdown timer<br>Measuring unit:1 second<br>Countdown start time setting range: 1 to 60 minutes (1-minute increments)<br>Reset time: 5 minutes<br>Others: Time up alarm, progress beeper</li><li>Daily alarms<br>5 independent daily alarms</li><li>Hourly time signal</li><li>Battery level indicator</li><li>Power Saving (display goes blank to save power when the watch is left in the dark)</li><li>Full auto-calendar (to year 2099)</li><li>12/24-hour format</li><li>Button operation tone on/off</li><li>Regular timekeeping: Hour, minute, second, pm, year, month, date, day</li><li>Accuracy: ±15 seconds per month</li><li>Approx. battery operating time:<br>6 months on rechargeable battery (operation period with normal use without exposure to light after charge)<br>23 months on rechargeable battery (operation period when stored in total darkness with the power save function on after full charge)</li><li>Size of case:?56.3?×?50.6?×?c?mm</li><li>Total weight: 80.2 g</li><li>EL:Blue Green</li></ul><br>', 2, 0, 0, 80.2, 5302000, 1, 2, 2070000, 1, 1448632346, 1478243522);
