(1042, 'PRG-250T-7', 'PRG-250T-7', 'PRG-250T-7', 'PRG250T7', 18, '1448632544.jpg', 1, '', 56.3, 50.6, 15, '200-meter water resistance for an expanded sphere of activity<br>Introducing new PRO TREK high-performance outdoor watch for various environments including mountain and ocean. This watch not only offers the compass bearing and altitude features necessary for mountain climbing, but also strong water-resistance for river climbing and river rafting where the user may encounter strong water pressure, as well as convenient tide information for sea kayaking and fishing.<br>With a large display delivering outstanding readability, the PRG-250 has a dual-layer LCD construction. The sensor and other data are shown on the upper and lower LCDs, allowing the user to easily see the desired information.<br>In addition to being displayed numerically and in a trend graph, atmospheric pressure is shown using simply designed arrow icons which depict characteristic barometric pressure patterns. This function was developed under the supervision of a meteorologist. Consequently, an upward arrow is displayed when the atmospheric pressure suddenly rises, forecasting better weather ahead.<br>A downward arrow appears when the pressure suddenly falls, indicating weather deterioration.<br>There are also arrow icons to show when rising pressure changes to falling pressure, or vice versa, making it easy to ascertain weather changes.<br>• Tough Solar<br>• Triple Sensor: Compass, Barometer/Thermometer, Altimeter<br>• Low temperature resistant (-10ºC/14°F)<br><ul><li><b>Direction Bezel</b></li><li><b>Mineral Glass</b></li><li><b>200-meter water resistance</b></li><li><b>Case / bezel material: Resin / Aluminum</b></li><li><b>Double-lock, 1-press, 3-fold Clasp</b></li><li><b>Titanium Band</b></li><li><b>Solid Band</b></li></ul><ul><li>Electro-luminescent backlight<br>Full auto EL light, selectable illumination duration, afterglow</li><li>Solar powered</li><li>Low-temperature resistant (-10°C/14°