ic pressure tendency graph<br>Atmospheric pressure differential graphic<br>*Changeover between hPa and inHg</li><li>Thermometer<br>Display range: -10 to 60 °C (14 to 140 °F)<br>Display unit: 0.1 °C (0.2 °F)<br>*Changeover between Celsius (°C) and Fahrenheit (°F)</li><li>Duplex LC display</li><li>World time<br>31 time zones (48 cities), city code display, daylight saving on/off</li><li>Sunrise, sunset time display<br>Sunrise time and sunset time for specific date, daylight pointers</li><li>1/100-second stopwatch<br>Measuring capacity: 23:59''59.99''''<br>Measuring modes: Elapsed time, split time, 1st-2nd place times</li><li>Countdown timer<br>Measuring unit: 1 second<br>Countdown range: 24 hours<br>Countdown start time setting range: 1 minute to 24 hours (1-minute increments and 1-hour increments)</li><li>5 daily alarms</li><li>Hourly time signal</li><li>Battery level indicator</li><li>Power Saving (display goes blank to save power when the watch is left in the dark)</li><li>Full auto-calendar (to year 2099)</li><li>12/24-hour format</li><li>Button operation tone on/off</li><li>Regular timekeeping: Hour, minute, second, pm, year, month, date, day</li><li>Accuracy: ±15 seconds per month</li><li>Approx. battery operating time:<br>6 months on rechargeable battery (operation period with normal use without exposure to light after charge)<br>23 months on rechargeable battery (operation period when stored in total darkness with the power save function on after full charge)</li><li>Size of case:?56.3?×?50.6?×?15.6?mm</li><li>Total weight: 87 g</li><li>EL:Blue Green</li></ul><div></div>', 2, 0, 0, 87, 5302000, 1, 2, 2070000, 1, 1448632835, 1478243536),
(1045, 'PRW-6000YT-1', 'PRW-6000YT-1', 'PRW-6000YT-1', 'PRW6000YT1', 18, '1448634375.png', 1, '', 57.9, 52.1, 12.8, '<strong>TRIPLE SENSOR</strong><br>Introducing a new addition to the PRO TREK lineup of analog-digital Triple Sensor Version 3 models.<br>In addition to sensor for taking bearing, altitude, and barometric pressure readings, a beeper alarm and digital display indicator alert you to significant changes in barometric pressure. An auto hand shift feature momentarily moves hands away from digital readouts when you check displayed readings, to make them easier to see.<br>Other features include a double LED illumination system for the face and digital display, Smart Access, Tough Solar, radio-controlled timekeeping and more. Highly scratch-resistant sapphire glass is used for the crystal, and a titanium alloy band with a black ion plate finish enable an elegant, lightweight design.<br>This watch is designed and engineered to make it the ultimate in ease of operation and reliability.<br>All this multi-functionality is packed into a 12.8 mm slim configuration.<br><strong>• MULTIBAND 6 reception of six time calibration signals: Japan (2), United States, Germany, England, China<br>• Tough Solar ensures stable operation even when using power-hungry functions.<br>• Triple Sensor: Compass, Barometer/Thermometer, Altimeter<br>• Low temperature resistant (–10ºC/14°F)</strong><br><ul><li><b>Black ion plated band</b></li><li><b>Black ion plated bezel</b></li><li><b>Neobrite</b></li><li><b>Sapphire Glass with non-reflective coating</b></li><li><b>100-meter water resistance</b></li><li><b>Case / bezel material: Resin / Stainless steel</b></li><li><b>Double-lock, 1-press, 3-fold Clasp</b></li><li><b>Titanium Band</b></li><li><b>Solid Band</b></li></ul><ul><ul><li>Double LED light<br>LED light for the face (Full auto LED light, selectable illumination duration, afterglow)<br>LED backlight for the digital display (Full auto LED light, selectable illumination duration, afterglow)</li><li>Solar powered</li><li>Low-temperature resistant (-10°C/14 °F)</li><li>Time calibration signal reception<br>Auto receive up to six* times a day (remaining auto receives canceled as soon as one is successful)<br>*5 times a day for the Chinese calibration signal<br>Manual receive<br>The latest signal reception results</li><li>Time Calibration Signals<br>Station name: DCF77 (Mainflingen, Germany)<br>Frequency: 77.5 kHz<br>Station name: MSF (Anthorn, England)<br>Frequency: 60.0 kHz<br>Station name: WWVB (Fort Collins, United States)<br>Frequency: 60.0 kHz<br>Station name: JJY (Fukushima, Fukuoka/Saga, Japan)<br>Frequency: 40.0 kHz (Fukushima) / 60.0 kHz (Fukuoka/Saga)<br>Station name: BPC (Shangqiu City, Henan Province, China)<br>Frequency: 68.5 kHz</li><li>The auto hand home position correction</li><li>Digital compass<br>Measures and displays direction as one of 16 points<br>Measuring range: 0 to 359°<br>Measuring unit: 1°<br>60 seconds continuous measurement<br>Hand indication of north<br>Bidirectional calibration<br>Magnetic declination correction</li><li>Altimeter<br>Measuring range: –700 to 10,000 m (–2,300 to 32,800 ft.)<br>Measuring unit: 1 m (5 ft.)<br>Hand indication of altitude differential<br>Manual memory measurements<br>(up to 30 records, each including altitude, date, time)<br>Auto log data (High/low altitudes, cumulative ascent and descent)<br>Others: Relative altitude readings (±100 m/±1000 m),<br>Selectable measurement interval: 5 seconds or 2 minutes<br>*1 second for first 3 minutes only<br>*Changeover between meters (m) and feet (ft)</li><li>Barometer<br>Display range: 260 to 1,100 hPa (7.65 to 32.45 inHg)<br>Display unit: 1 hPa (0.05 inHg)<br>Hand indication of pressure differential<br>Atmospheric pressure tendency graph<br>Barometric pressure tendency information alarm (beep and arrow indicates significant changes in pressure)<br>*Changeover between hPa and inHg</li><li>Thermometer<br>Display range: -10 to 60 °C (14 to 140 °F)<br>Display unit: 0.1 °C (0.2 °F)<br>*Changeover between Celsius (°C) and Fahrenheit (°F)</li><li>World time<br>29 time zones (29 cities + coordinated universal time), One-touch UTC Time Zone Access, daylight saving on/off, Home city/World time city swapping</li><li>1/100-second stopwatch<br>Measuring capacity: 23:59''59.99''''<br>Measuring modes: Elapsed time, split time, 1st-2nd place times</li><li>Countdown timer<br>Measuring unit: 1 second<br>Countdown range: 60 minutes<br>Countdown start time setting range: 1 second to 60 minutes (1-second increments, 1-minute increments)</li><li>5 daily alarms</li><li>Hourly time signal</li><li>Hand shift feature (manual or auto (during altitude, barometric pressure, and temperature measurement))</li><li>Battery level indicator</li><li>Power Saving (display goes blank and hands stop to save power when the watch is left in the dark)</li><li>Full auto-calendar (to year 2099)</li><li>12/24-hour format</li><li>Button operation tone on/off</li><li>Regular timekeeping:<br>Analog: 3 hands (hour, minute (hand moves every 10 seconds), second)<br>Digital: Hour, minute, second, am, pm, date, day</li><li>Accuracy: ±15 seconds per month (with no signal calibration)</li><li>Approx battery operating time:<br>6 months on rechargeable battery (operation period with normal use without exposure to light after charge)<br>23 months on rechargeable battery (operation period when stored in total darkness with the power save function on after full charge)</li></ul><li>Size of case:?57.9?×?52.1?×?12.8?mm</li><li>Total weight: 110 g</li><li>LED:White</li></ul>', 2, 0, 0, 110, 13111000, 1, 0, 5194000, 1, 1448634375, 1478243542),
(1048, 'PRG-270D-7', 'PRG-270D-7', 'PRG-270D-7', 'PRG270D7', 18, '1448635007.png', 1, '', 54.6, 52.4, 14.4, '<strong>TRIPLE SENSOR<br></strong>Introducing Triple Sensor Version 3, advanced CASIO original technology that makes it possible to pack sensors that are 95% smaller than those of previous models into a totally new type of compact PRO TREK. Despite their smaller size, the new sensors in this model delivers higher reading accuracy and improved energy efficiency.<br>This Triple Sensor model provides altitude, barometric pressure, and direction readings that are more accurate than previous models, and a Barometric Pressure Tendency Alarm alerts the wearer to sudden changes in pressure readings.<br>Design features include a case built for outdoor gear performance. Large side buttons and one-press access to digital compass, barometric pressure and altitude, and temperature readings keep important information at your fingertips.<br>Other features include Tough Solar, 100-meter water resistance, and more.<br>Everything about this model is designed and engineered to make them essentialpieces of outdoor gear.<br><strong>• Tough Solar ensures stable operation even when using power-hungry functions.<br>• Triple Sensor: Compass, Barometer/Thermometer, Altimeter<br>• Low temperature resistant (–10ºC/14°F)</strong><br><ul><li><b>Mineral Glass</b><br></li><li><b>100-meter water resistance</b></li><li><b>Case / bezel material: Resin</b></li><li><b>Double-lock, 3-fold Clasp</b></li><li><b>Stainless Steel Band</b></li><li><b>Solid Band</b></li></ul><ul><li>LED backlight (Super Illuminator)<br>Full auto LED light, selectable illumination duration,&nbsp;afterglow</li><li>Solar powered</li><li>Low-temperature resistant (–10°C/14°F)</li><li>Digital compass<br>Measures and displays direction as one of 16 points<br>Measuring range: 0 to 359°<br>Measuring unit: 1°<br>60 seconds continuous measurement<br>Graphic direction pointer<br>Bidirectional calibration<br>Magnetic declination correction<br>Bearing memory</li><li>Altimeter<br>Measuring range: –700 to 10,000 m (–2,300 to 32,800 ft.)<br>Measuring unit: 1 m (5 ft.)<br>Manual memory measurements&nbsp;(up to 30 records, each including altitude, date, time)<br>Auto log data (High/low altitudes, auto cumulative ascent and&nbsp;descent)<br>Trek log data (up to 14 records of high/low altitudes, auto&nbsp;cumulative ascent and descent of particular treks)<br>Others: Relative altitude readings (–3,000 to 3,000 m),&nbsp;Selectable measurement interval: 5 seconds or 2 minutes<br>*1 second for first 3 minutes only<br>*Changeover between meters (m) and feet (ft)</li><li>Barometer<br>Display range: 260 to 1,100 hPa (7.65 to 32.45 inHg)<br>Display unit: 1 hPa (0.05 inHg)<br>Atmospheric pressure tendency graph (past 42 hours of readings)<br>Atmospheric pressure differential graphic<br>Barometric pressure tendency information alarm (beep and arrow indicate significant changes in pressure)<br>*Changeover between hPa and inHg</li><li>Thermometer<br>Display range: –10 to 60°C (14 to 140°F)<br>Display unit: 0.1°C (0.2°F)<br>*Changeover between Celsius (°C) and Fahrenheit (°F)</li><li>World time<br>31 time zones (48 cities + coordinated universal time), daylight saving on/off</li><li>Sunrise, sunset time display<br>Sunrise time and sunset time for specific date, daylight&nbsp;pointers</li><li>1/10-second stopwatch<br>Measuring capacity: 999:59''59.9”<br>Measuring modes: Elapsed time, split time, 1st-2nd place&nbsp;times</li><li>Countdown timer<br>Measuring unit: 1 second<br>Countdown range: 24 hours<br>Countdown start time setting range: 1 minute to 24 hours&nbsp;(1-minute increments and 1-hour increments)</li><li>5 daily alarms (with 1 snooze alarm)</li><li>Hourly time signal</li><li>Battery level indicator</li><li>Power Saving (display goes blank to save power when the&nbsp;watch is left in the dark)</li><li>Full auto-calendar (to year 2099)</li><li>12/24-hour format</li><li>Button operation tone on/off</li><li>Regular timekeeping: Hour, minute, second, pm, year,&nbsp;month, date, day</li><li>Accuracy: ±15 seconds per month</li><li>Approx battery operating time:<br>9 months on rechargeable battery (operation period with&nbsp;normal use without exposure to light after charge)<br>24 months on rechargeable battery (operation period when&nbsp;stored in total darkness with the power save function on&nbsp;after full charge)&nbsp;</li><li>Size of case:?54.6?×?52.4?×?14.4?mm</li><li>Total weight: 149 g</li><li>LED:White</li></ul>', 2, 0, 0, 149, 5444000, 0, 2, 2127000, 0, 1448635007, 1448639824),
