a (7.65 to 32.45 inHg)<br>Display unit: 1 hPa (0.05 inHg)<br>Atmospheric pressure tendency graph<br>Atmospheric pressure differential graphic<br>Barometric pressure tendency information alarm (beep and arrow indicates significant changes in pressure)<br>*Changeover between hPa and inHg</li><li>Thermometer<br>Display range: –10 to 60°C (14 to 140°F)<br>Display unit: 0.1°C (0.2°F)<br>*Changeover between Celsius (°C) and Fahrenheit (°F)</li><li>World time<br>31 time zones (48 cities + coordinated universal time), city&nbsp;name display, daylight saving on/off</li><li>Sunrise, sunset time display<br>Sunrise time and sunset time for specific date, daylight&nbsp;pointers</li><li>1/100-second stopwatch<br>Measuring capacity: 999:59''59.9''''<br>Measuring modes: Elapsed time, split time, 1st-2nd place&nbsp;times</li><li>Countdown timer<br>Measuring unit: 1 second<br>Countdown range: 24 hours<br>Countdown start time setting range: 1 minute to 24 hours&nbsp;(1-minute increments and 1-hour increments)</li><li>5 daily alarms (with 1 snooze alarm)</li><li>Hourly time signal</li><li>Battery level indicator</li><li>Power Saving (display goes blank to save power when the&nbsp;watch is left in the dark)</li><li>Full auto-calendar (to year 2099)</li><li>12/24-hour format</li><li>Button operation tone on/off</li><li>Regular timekeeping: Hour, minute, second, pm, month, date, day</li><li>Accuracy: ±15 seconds per month (with no signal&nbsp;calibration)</li><li>Approx battery operating time:<br>8 months on rechargeable battery (operation period with&nbsp;normal use without exposure to light after charge)<br>23 months on rechargeable battery (operation period when&nbsp;stored in total darkness with the power save function on&nbsp;after full charge)&nbsp;</li><li>LED:White</li></ul>', 2, 1, 0, 93, 5856000, 1, 2, 2292000, 62, 1437664919, 1477999473);
